DIV id=ViEtDeVdIvId style=&quot;POSITION:Relative;FONT-FAMILY:Arial;FONT-SIZE:11px&quot;&gt;&lt;/DIV&gt;','lyang, 2014-09-15 10:22:18;'),('SEQF1541',NULL,'','352165','','','0','60.77',NULL,NULL,NULL,NULL,NULL,NULL,'Oral isolate (mouth)',0,NULL,NULL,NULL,NULL,'Synergistes[G-2] sp. oral taxon 357',NULL,0,'As regards our phenotypic characterisation of the two Synergistes species, most of our findings have been negative. They are obligate anaerobes and asaccharolytic so will be expected to have a proteolytic metabolism. The end-products of metabolism are acetic, propionic, iso-butyric, iso-valeric,&lt;BR&gt;succinic and phenyl-acetic acids. The negative characteristics are that they do not hydrolyse aesculin or arginine; do not produce gelatinase, urease, catalase or indole. William Wade&lt;BR&gt;Section 1&lt;BR&gt;Description of Synergistes W5455 and W5706&lt;BR&gt;Cells are obligately anaerobic, non-motile, Gram-negative bacilli (0.7 &amp;#956;m x 0.8  3 &amp;#956;m with occasional cells up to 6 &amp;#956;m long).  After 7 d incubation o&shy;n FAA plates colonies are 0.7 mm in diameter, circular, entire, high convex, smooth, shiny, grey and opaque and have a fishy odour.  Moderate growth is obtained in broth media and growth is not enhanced by the addition of carbohydrates.  Cells are asaccharolytic and arabinose, cellobiose, fructose, glucose, lactose, maltose, mannitol, mannose, rhamnose, salicin, sucrose, trehalose, and xylose are not fermented.  Major amounts of acetic acid and minor amounts of propionic, isovaleric, succinic and phenyl-acetic acids are produced as end products of metabolism in PYG.  The non-hydroxylated fatty acid profile is {To Follow}.  Aesculin, gelatin and urea are not hydrolyzed.  Indole and catalase are not produced and nitrate is not reduced.  There is no growth in 20% bile.  The Rapid ID32A (bioMerieux) profile is 0000 00/404/600 which corresponds to a strong positive reaction for glycine arylamidase and weak reactions for leucyl glycine arylamidase and alanine arylamidase.  The G+C content of the DNA is 59  60 mol %.&lt;BR&gt;The type strain is W5455T(=DSM XXX0000T=CCUG YY000T).&lt;BR&gt;&lt;BR&gt;Section 2&lt;BR&gt;Julie and Will:&lt;BR&gt;Attached is the representative data for the 3 strains from the phylum Synergistes.  FAME profiles are complex but strains 5455 and 5706 were clearly distinct from strain 3877.  Comments o&shy;n the data are as follows:&lt;BR&gt;&lt;BR&gt;1.    strains 5455 and 5706.  This data is intriguing but also frustrating as I dont at present have appropriate standards to identify a significant quantity (~50%_ or the FAMEs, which limits the chemotaxonomic value of the data.  However it is clear that the unidentified FAMEs run as a series, each with a retention time just slightly longer than a saturated FAME.  These may therefore belong to a particular FAME type (e.g. hydroxyl or cyclopropane fatty acids) so Ill see if I can track down some relevant standards.&lt;BR&gt;&lt;BR&gt;2.    strain 3877.  Im reasonably confident with the identification of the majority of these FAME (~90%) but note (see my previous email) that when derivatising this sample I experienced technical problems so the extraction may not be valid.  It would be useful to repeat this if you could send more biomass.&lt;BR&gt;&lt;BR&gt;Leaving aside the above caveats, I did some literature searching o&shy;n the various close relatives of these strains as indicated by the tree Will sent.  What is striking is that, as far as I can tell, there is no published fatty acid data in any of the species descriptions for these taxa (I looked at references for the genera Dethiosulfovbrio, Synergistes, Thermanaerovibrio, Aminomonas, Aminobacterium and Anaerobaculum).  Id appreciate if you could check any relevant literature you have, to confirm the absence of FAME data.&lt;BR&gt;This means that comparative FAME data would probably not be needed for publication purposes.  The value of this data will thus be determined by whether I can provisionally identify the unknowns in the 5455/5706 samples.&lt;BR&gt;&lt;BR&gt;Hope this is clear.&lt;BR&gt;&lt;BR&gt;Regards.  &lt;BR&gt;&lt;BR&gt;Lain  &lt;BR&gt;&lt;BR&gt;Section 3&lt;BR&gt;&lt;BR&gt;&lt;BR&gt;Dear Floyd:&lt;BR&gt;&lt;BR&gt;Please find attached the description for the 2 novel strains of Synergistes W5455 and W5706.  Lain has run the FAME but is still analyzing the results so that is still to follow.&lt;BR&gt;William said you were also interested in an indication of sensitivity for these strains.  I have done a basic disc test o&shy;n a lawn culture of growth for both strains and based o&shy;n the lose definition that a large zone of growth inhibition around the disc is sensitive and no zone is resistant the results were as follows:&lt;BR&gt;Sensitive to penicillin, ampicillin, amoxicillin, tetracycline, clindamycin and metronidazole.&lt;BR&gt;Resistant (no zone at all) to erythromycin, ciprofloxacin, gentamicin and trimethoprim.&lt;BR&gt;Zones to defadroxil and cefrazidime were more hazy and intermediate in size so I wouldnt want to call either way just o&shy;n the basis of the disc test.&lt;BR&gt;We dont do antibiotic testing o&shy;n our research anaerobes, so the antibiotics I tested where just the discs that our diagnostic service had in stock.  In the past when I have done work with antibiotic sensitivity testing for anaerobes, I have used the agar dilution method as recommended by the NCCLS as the disc method is not that great for anaerobes.&lt;BR&gt;Hope this information is of some interest though.&lt;BR&gt;Best regards.&lt;BR&gt;Julie','Full Name:	 Pyramidobacter piscolens W5455 (TFI-JCVI)<br>\nSEQ_ID:	SEQF1541<br>\nTotal contigs received: 905<br>\nTotal bps received: 619541<br>\nAverage GC%: 60.77 (of total bps received)<br>	\nLongest contig: 2231 bps<br>\nShortest contig: 100 bps<br>\nContigs 100 - 300 bps:	127<br>\nContigs 301 - 500 bps:	74<br>\nContigs 501 - 1000 bps:	483<br>\nContigs 1001 - 1500 bps:	149<br>\nContigs > 