&lt;/DIV&gt;','',0,'&lt;DIV id=ViEtDeVdIvId style=&quot;POSITION:Relative;FONT-FAMILY:Arial;FONT-SIZE:11px&quot;&gt;&lt;/DIV&gt;',NULL,NULL,'&lt;DIV id=ViEtDeVdI',' tsute, 2016-04-19 08:36:23;'),('SEQF1253',NULL,'18101','410253','Gi01697',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Don\'t know','Human',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Strain PittFF is a non-typeable Haemophilus influenzae (NTHi) isolate recovered by Dr. Robert Wadowsky from the external auditory canal of an otorrheic child in Pittsburgh who had spontaneously perforated his tympanic membrane. In the chinchilla model, PittFF infection induces virulent otologic disease and rapid systemic disease.&lt;BR&gt;Haemophilus. A group of organisms that are either obligate parasites or commensal organisms found in animal mucous membranes. Almost all species require the presence of important growth factors found in the blood of their hosts, including either X factor (protoporphyrin IX or heme) or V factor (nicotinamide adenine dinucleotide (NAD or NADP)).&lt;BR&gt;Haemophilus influenzae. This organism was first isolated in the 1890s during an influenza pandemic by Pfeiffer, and was originally thought to be the source of influenza, although later it was shown to be a secondary pathogen and may be synergistic with the influenza virus. This bacterium is o&amp;shy;ne of the leading causes of meningitis in young children, and it may also cause septicemia, otitis media (inflammation of the middle ear), sinusitis (inflammation of the sinus cavity) and chronic bronchitis. It is highly adapted to its human host and typically lives in the nasopharynx and is a major cause of lower respiratory infections in infants and small children in developing countries (type 1b strain), although vaccine use has resulted in the decline of infections. The presence of the type B polysaccharide is important for virulence, as it is the most pathogenic of the 6 major types. The encapsulated organism can penetrate the blood and avoid both phagocytosis and complement-mediated lysis. All known strains produce neuraminidase and an IgA protease as well as fimbrial adhesins for attachment. &lt;BR&gt;&lt;BR&gt;Haemophilus influenzae PittFF. Sequenced and assembled using technology developed by 454 Life Sciences, Inc. (www.454.com). The genome sequence is currently comprised of 53 contigs. Strain PittFF is a non-typeable Haemophilus influenzae (NTHi) isolate recovered by Dr. Robert Wadowsky from the external auditory canal of an otorrheic child in Pittsburgh who had spontaneously perforated his tympanic membrane. In the chinchilla model, PittFF infection induces virulent otologic disease and rapid systemic disease. Please see Shen et al. (2005) Infect. Immun. 73, 3479-91.',NULL,NULL,NULL,''),('SEQF1258',NULL,'18103','410254','Gi01698',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Don\'t know','Ear',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),('SEQF1426',NULL,'18571','419110','Gi01695',NULL,NULL,'67',NULL,NULL,NULL,NULL,NULL,NULL,'Environment',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),('SEQF1427',NULL,'18099','410252','Gi01696',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ear',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),('SEQF1428',NULL,'18005','410290','Gi01703',NULL,NULL,'50',NULL,NULL,NULL,NULL,NULL,NULL,'Animal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),('SEQF1429','','18083','481805','SAMN02598405','CP000946','0','50.86','GCA_000019385.1','','','','','','Gut',0,'','Rod','-','','','',0,'',NULL,NULL,'',''),('SEQF1430','','16718','405955','SAMN02603424','CP000468,DQ517526,DQ381420','0','50.34','GCA_000014845.1','','','','','','Gut',0,'','','','','','',0,'',NULL,NULL,'',''),('SEQF1431',NULL,'18801','426430','SAMD00060913','AP009351',NULL,'32.88','GCA_000010465.1',NULL,NULL,NULL,NULL,NULL,'Animal',NULL,NULL,'Coccus','+',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'NCBI Name : Staphylococcus aureus subsp. aureus',' pgajare, 2018-08-17 14: